.container {
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
}

.navbar {
  position: sticky;
  top: 0;
  z-index: 100;
  padding: 1.5rem 0;
  background: transparent;
  transition: all 0.3s ease;
}

.navbar.landing {
  background: rgba(253, 250, 245, 0.9);
  backdrop-filter: blur(8px);
}

.navbar.expedition {
  background: white;
  border-bottom: 1px solid #edf2f7;
}

.navbar.dark {
  background: var(--color-urban-dark);
  color: white;
}

.nav-content {
  display: flex;
  justify-content: space-between;
  align-items: center;
}

.logo {
  display: flex;
  align-items: center;
  gap: 0.5rem;
  color: inherit;
  font-weight: 700;
  font-family: var(--font-serif);
  font-style: italic;
  font-size: 1.25rem;
}

.logo-icon {
  color: var(--color-landing-primary);
}

.nav-links {
  display: flex;
  align-items: center;
  gap: 2rem;
}

.nav-link {
  font-size: 0.875rem;
  font-weight: 500;
  color: #4a5568;
  transition: color 0.2s;
}

.navbar.dark .nav-link {
  color: #cbd5e1;
}

.nav-link:hover {
  color: var(--color-landing-primary);
}

.nav-btn {
  background: #526154;
  color: white;
  padding: 0.75rem 1.5rem;
  border-radius: 9999px;
  font-weight: 600;
  font-size: 0.875rem;
  transition: transform 0.2s, opacity 0.2s;
}

.navbar.expedition .nav-btn {
  background: #3182ce;
  border-radius: 4px;
}

.navbar.dark .nav-btn {
  background: #38bdf8;
  color: var(--color-urban-dark);
}

.nav-btn:hover {
  opacity: 0.9;
  transform: translateY(-1px);
}

/* Footer */
.footer {
  padding: 4rem 0 2rem;
  margin-top: 4rem;
}

.footer.landing {
  background: #526154;
  color: white;
}

.footer.landing .logo-icon {
  color: white;
}

.footer.expedition {
  background: #f7fafc;
  color: #4a5568;
  border-top: 1px solid #edf2f7;
}

.footer-content {
  display: grid;
  grid-template-columns: 1fr 1fr 1fr;
  align-items: start;
  gap: 3rem;
  padding-bottom: 3rem;
  border-bottom: 1px solid rgba(255, 255, 255, 0.1);
}

.footer.expedition .footer-content {
  border-bottom: 1px solid #e2e8f0;
}

.footer-brand {
  display: flex;
  flex-direction: column;
  gap: 1rem;
}

.footer-tagline {
  font-size: 0.875rem;
  opacity: 0.8;
}

.footer-links {
  display: flex;
  justify-content: center;
  gap: 1.5rem;
  font-size: 0.875rem;
}

.footer-social {
  display: flex;
  justify-content: flex-end;
  gap: 1rem;
}

.footer-bottom {
  text-align: center;
  padding-top: 2rem;
  font-size: 0.75rem;
  opacity: 0.6;
