.page-urban {
  background: #f8fafc;
  color: #0f172a;
}

.urban-hero {
  padding: 6rem 0;
}

.hero-grid {
  display: grid;
  grid-template-columns: 1fr 1.2fr;
  gap: 5rem;
  align-items: center;
}

.hero-img-box {
  position: relative;
}

.hero-img-box img {
  width: 100%;
  border-radius: 1rem;
  box-shadow: 0 25px 50px -12px rgba(0, 0, 0, 0.15);
}

.img-label {
  position: absolute;
  bottom: 1.5rem;
  left: 1.5rem;
  background: rgba(0,0,0,0.6);
  color: white;
  padding: 0.25rem 0.75rem;
  border-radius: 0.25rem;
  font-size: 0.7rem;
  font-weight: 700;
  backdrop-filter: blur(4px);
}

.location-badge {
  font-size: 0.75rem;
  font-weight: 700;
  color: #64748b;
  letter-spacing: 0.1em;
  display: flex;
  align-items: center;
  gap: 0.5rem;
  margin-bottom: 1.5rem;
}

.location-badge::before {
  content: '';
  width: 12px;
  height: 12px;
  background: #38bdf8;
  border-radius: 50%;
}

.urban-title {
  font-size: 4.5rem;
  font-weight: 800;
  line-height: 1;
  margin-bottom: 1.5rem;
  letter-spacing: -0.04em;
}

.accent-line {
  width: 60px;
  height: 4px;
  background: #38bdf8;
  margin-bottom: 2rem;
}

.accent-line.center {
  margin: 2rem auto;
}

.hero-text p {
  font-size: 1.125rem;
  color: #475569;
  line-height: 1.8;
  margin-bottom: 2.5rem;
}

.hero-btns {
  display: flex;
  gap: 1rem;
  margin-bottom: 3rem;
}

.btn-dark {
  background: #0f172a;
  color: white;
  padding: 1rem 2rem;
  border-radius: 0.5rem;
  font-weight: 600;
  display: flex;
  align-items: center;
  gap: 0.75rem;
}

.btn-outline {
  border: 1px solid #e2e8f0;
  padding: 1rem 2rem;
  border-radius: 0.5rem;
  font-weight: 600;
  display: flex;
  align-items: center;
  gap: 0.75rem;
}

.social-proof {
  display: flex;
  align-items: center;
  gap: 1rem;
  font-size: 0.875rem;
  color: #64748b;
}

/* Moments Gallery */
.moments-section {
  padding: 6rem 0;
}

.shots-grid {
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 1.5rem;
  margin-top: 3rem;
}

.shot-card {
  position: relative;
  height: 600px;
  border-radius: 1rem;
  overflow: hidden;
}

.shot-card img {
  width: 100%;
  height: 100%;
  object-fit: cover;
  transition: transform 0.5s ease;
}

.shot-card:hover img {
  transform: scale(1.05);
}

.shot-overlay {
  position: absolute;
  inset: 0;
  background: linear-gradient(transparent, rgba(0,0,0,0.8));
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
  padding: 2.5rem;
  color: white;
}

.shot-time {
  font-size: 0.75rem;
  font-weight: 700;
  color: #38bdf8;
  margin-bottom: 0.5rem;
}

.shot-title {
  font-size: 1.5rem;
  font-weight: 700;
  line-height: 1.2;
}

/* Quote */
.urban-quote {
  padding: 8rem 0;
  text-align: center;
}

.quote-icon-large {
  color: #e2e8f0;
  margin-bottom: 3rem;
}

.urban-quote blockquote {
  font-size: 2.5rem;
  font-weight: 300;
  font-family: var(--font-sans);
  line-height: 1.4;
  max-width: 900px;
  margin: 0 auto;
  color: #1e293b;
}

.urban-quote cite {
  font-size: 0.875rem;
  font-weight: 700;
  color: #94a3b8;
  letter-spacing: 0.2em;
}

/* Newsletter Dark */
.urban-newsletter {
  padding: 4rem 2rem 8rem;
}

.newsletter-dark-box {
  background: #0f172a;
  color: white;
  padding: 6rem;
  border-radius: 2rem;
  text-align: center;
}

.title-large {
  font-size: 3.5rem;
  font-weight: 800;
  margin-bottom: 1.5rem;
}

.dark-form {
  display: flex;
  gap: 1rem;
  max-width: 600px;
  margin: 3rem auto 1.5rem;
}

.dark-form input {
  flex: 1;
  background: rgba(255,255,255,0.05);
  border: 1px solid rgba(255,255,255,0.1);
  padding: 1.25rem 2rem;
  border-radius: 0.5rem;
  color: white;
}

.dark-form button {
  background: #38bdf8;
  color: #0f172a;
  padding: 1.25rem 3rem;
  border-radius: 0.5rem;
  font-weight: 700;
}

